import Feed from "../components/Feed";
import Trending from "../components/Trending";
import "./mainPage.css";


export default function MainPage(){
    return(
        <div className="MainPage">


                <div className="feedContainer">
                    <Feed />
                </div>
                <div className="trendingContainer">
                    <Trending />
                </div>



        </div>
    );
}
